import React from "react";
import "./forms.css";

const FormInputs = (props) => {
  return (
    <div className="formInput">
      <input
        className="input-rows"
        placeholder={props.placeholder}
        onChange={(e) => props.setValues(e.target.value)}
      />
    </div>
  );
};

export default FormInputs;
